import { LatestImageResponseType } from '../types/latestImageResponseType'
const transformResponseToType = (responseStr: Map<string, any>): LatestImageResponseType => {
  return {
    latestImage: (responseStr['image_path'] as string).replaceAll('"', ''),
    latestImageCreatedAt: new Date(responseStr.get('createdAt'))
  }
}


export const getLastImage = async (sectÍorId: number): Promise<LatestImageResponseType> => {
  const res = await fetch(`${process.env.REACT_APP_API_BASE_URL}/get_last_image?sector_id=${sectorId}`)
  return transformResponseToType(await res.json())
}
